import React, { useEffect } from 'react';
import { ThemeProvider } from 'theme-ui';
import theme from 'theme';
import SEO from 'components/seo';
import Layout from 'components/layout';
import Banner from 'sections/banner';
import Services from 'sections/services';
import PremiumFeature from 'sections/premium-feature';
import UltimateFeatures from 'sections/ultimate-feature';
import CustomerSupport from 'sections/customer-support';
import Pricing from 'sections/pricing';
import Testimonials from 'sections/testimonials';
import Blog from 'sections/blog';
import Faq from 'sections/faq';
import Support from 'sections/support';
import { axios } from './api/axios'

export default function IndexPage() {
  async function teste() {
    const results = await axios.get('/noticias')
    console.log(results)
  }
  teste()

  return (
    <ThemeProvider theme={theme}>
      <Layout>
        <SEO
          title="Modelo Contabilidade"
          description="Modelo de Contabilidade planejado para melhor atender as necessidades da sua empresa"
        />
        <Banner />
        {/* <Services /> */}
        <PremiumFeature />
        <UltimateFeatures />
        {/* <CustomerSupport /> */}
        <Pricing />
        {/* <Testimonials /> */}
        <Blog />
        {/* <Faq /> */}
        {/* <Support /> */}
      </Layout>
    </ThemeProvider>
  );
}
